import React from 'react';

const AdviceCard = ({ advice }) => {
  return (
    <div className='advice-card'>
      <h2 className='advice-title'>ADVICE #117</h2>
      {advice && <p className='advice-text'>{advice}</p>}
      <img src='/pattern-divider-desktop.svg' alt='Pattern Divider' className='divider' />
      <div className='dice-container'>
        <img className='dice-img' src='/icon-dice.svg' alt='Dice Icon' />
      </div>
    </div>
  );
};

export default AdviceCard;
